import styled from 'styled-components';

export const HeaderNav = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 30px 10%;

  li,
  a {
    font-weight: 500;
    font-size: 16px;
    color: black;
    text-decoration: none;
  }
`;
